import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    constructor(props){
        super(props);
        this.state = {
            listings: []
        }
    }

    listings = [""];
    buffer = "";

    componentDidMount()
    {
        const buffer = [];
        var arr;

        fetch(raw)
            .then(r => r.text())
            .then(text => {
                buffer = text;
                
            });
        console.log('buffer is ', buffer);
        

    }

    render()
    {
        return (

            <ul>
                {
                    this.listings
                        .map((listing, index) =>
                            <li key={index}>
                                { listing }
                            </li>
                        )
                }
            </ul>
        );
    }


}
